 Для создания функции в Swift, которая сортирует массив целых чисел и выводит его на экран, можно использовать следующий код:

```swift
import Foundation

func sortAndPrintArray(of numbers: [Int]) {
    // Сортируем массив
    let sortedNumbers = numbers.sorted()

    // Выводим отсортированный массив на экран
    for number in sortedNumbers {
        print(number)
    }
}

// Пример использования функции
let exampleArray = [5, 3, 8, 4, 2, 9, 1]
sortAndPrintArray(of: exampleArray)
```

Эта функция `sortAndPrintArray` принимает массив целых чисел `numbers` в качестве параметра. Она использует метод `sorted()` для сортировки массива и затем перебирает его элементы с помощью цикла `for-in` для вывода их на экран.

 To create a Discord bot using Discord.js v14 that responds to a slash command called "ban", you'll need to follow these steps:

1. Set up a Discord bot by creating a new application in the Discord Developer Portal.
2. Obtain the bot token.
3. Install the necessary packages.
4. Create a new JavaScript file and set up the bot.

Here's a complete example of a Discord bot using Discord.js v14 that responds to the slash command "ban":

```javascript
const { Client, Intents, CommandInteraction, SlashCommandBuilder } = require('discord.js');

// Create a new client instance
const client = new Client({ intents: [Intents.FLAGS.GUILDS, Intents.FLAGS.GUILD_MESSAGES] });

// Command builder
const command = new SlashCommandBuilder()
    .setName('ban')
    .setDescription('Bans a user from the server');

// Add the command to the client
client.commands = new Map();
client.commands.set('ban', command);

// When the client is ready, log in to Discord with the client
client.once('ready', () => {
    console.log('Ready!');
});

// Login to Discord with your bot token
client.login('YOUR_BOT_TOKEN');

// Handle command interactions
client.on('interactionCreate', (interaction) => {
    if (!interaction.isCommandGroup()) return;
    if (interaction.commandName !== 'slashCommands') return;

    const command = interaction.client.commands.get(interaction.commandName);

    if (!command) return interaction.reply({ content: 'This command does not exist.', ephemeral: true });

    try {
        command.execute(interaction);
    } catch (error) {
        console.error(error);
        interaction.reply({ content: 'There was an error while executing this command!', ephemeral: true });
    }
});
```

### Explanation:

- **Discord.js Setup**: We import the necessary parts of Discord.js, including `CommandInteraction` for handling command interactions and `SlashCommandBuilder` for creating slash commands.
- **Command Creation**: We use `SlashCommandBuilder` to create a new slash command named "ban" with a description.
- **Command Handling**: The bot listens for command interactions. When an interaction is created, it checks if it's a slash command interaction and if it's the correct command.
- **Command Execution**: If the command exists, it executes the command using the `execute` method.

### Deployment:

1. **Replace `'YOUR_BOT_TOKEN'`**: Replace `'YOUR_BOT_TOKEN'` with your actual bot token.
2. **Run the bot**: You can run the bot by executing the script.

### Note:

- Ensure you have the necessary intents enabled in your Discord Developer Portal to allow the bot to interact with guilds and messages.
- This example assumes you are running the bot in a Node.js environment.
- Always handle errors gracefully in production code to prevent crashes and provide useful error messages to users.

This setup provides a basic structure for a Discord bot with slash commands. You can expand the functionality by adding more commands, event listeners, and handling various other interactions.

