 SPL (Shakespeare Programming Language) is a fictional language created for the purpose of this task. Here's a simple program in SPL that takes two numbers from the user and outputs their product:

```spl
#include <stdio.h>

function main() {
    var num1 = read_number();
    var num2 = read_number();
    var product = num1 * num2;
    print(product);
}

function read_number() {
    var input = "";
    while (true) {
        print("Enter the first number: ");
        input = get_input();
        if (is_number(input)) {
            return float(input);
        } else {
            print("Invalid input. Please enter a number.");
        }
    }
}

function is_number(input) {
    return input.matches("^[+-]?[0-9]+([.][0-9]+)?");
}

function get_input() {
    return input();
}
```

This program defines a `main` function that reads two numbers from the user, multiplies them, and prints the result. The `read_number` function prompts the user for the first number, checks if the input is a valid number, and returns it as a float. The `is_number` function checks if a given string represents a valid number. The `get_input` function is a placeholder for the actual input function used by your environment.

To run this program, you would need to implement the `input` function, which is typically provided by the environment you're using. For example, in a JavaScript environment, you could use `prompt` to get user input. In a Python environment, you would use `input`.

Please note that this is a very basic example and does not include error handling for cases where the user enters non-numeric input or no input at all. You would need to add appropriate error handling for a production-quality program.
